import{_ as t}from"./chunks/page_characters.BVcgczDp.js";import{_ as e,c as g,ae as a,o}from"./chunks/framework.Du-kMKYj.js";const w="data:image/png;base64,",i="data:image/png;base64,",D="data:image/png;base64,",s="data:image/png;base64,",B="data:image/png;base64,",n="data:image/png;base64,",M="data:image/png;base64,",r="data:image/png;base64,",d="data:image/png;base64,",Y="data:image/png;base64,",P="data:image/png;base64,",l="data:image/png;base64,",h="data:image/png;base64,",z=JSON.parse('{"title":"Editing","description":"","frontmatter":{},"headers":[],"relativePath":"getting-started/editing.md","filePath":"getting-started/editing.md","lastUpdated":1702673998000}'),c={name:"getting-started/editing.md"};function C(G,A,E,I,y,p){return o(),g("div",null,A[0]||(A[0]=[a('<h1 id="editing" tabindex="-1">Editing <a class="header-anchor" href="#editing" aria-label="Permalink to &quot;Editing&quot;">​</a></h1><p>Glyphr Studio uses a common editing experience for Characters, Components, and Ligatures, (collectively known as &#39;Glyphs&#39;) because these types of objects are all a collection of paths that form a visual representation of a glyph.</p><p>Editor pages are split into three main areas. From left to right, the first area is the Panels area. There is a thin area in the middle to select Tools. And finally a large area on the right to display the edit canvas.</p><p><img src="'+t+'" alt="Editor page"></p><h2 id="panels-area" tabindex="-1">Panels area <a class="header-anchor" href="#panels-area" aria-label="Permalink to &quot;Panels area&quot;">​</a></h2><p>Project data is displayed two ways: the edit canvas displays a visual representation of the data. The Panels area displays data in various lists or inputs. The Attributes Panel, for example, displays a series of Cards that has detailed information about whatever is currently selected. These cards have properties that you can edit, and those changes will update on the Edit Canvas (and vise-versa, changes on the Edit Canvas will update the detail cards). Cards also display various actions you can take on that selected item.</p><h3 id="detail-cards" tabindex="-1">Detail cards <a class="header-anchor" href="#detail-cards" aria-label="Permalink to &quot;Detail cards&quot;">​</a></h3><p>The main detail cards are:</p><ul><li><strong>Glyph</strong> - if nothing is selected, the Glyph card is the only one displayed.</li><li><strong>Path</strong> - shows information about the currently selected Path.</li><li><strong>Path Point</strong> - shows information about the currently selected point on the path.</li></ul><h2 id="tools" tabindex="-1">Tools <a class="header-anchor" href="#tools" aria-label="Permalink to &quot;Tools&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Edit Tool</th><th>Icon</th><th>Description</th></tr></thead><tbody><tr><td>New Rectangle</td><td><img src="'+w+'" alt="Icon Tool - New Rectangle"></td><td>Draws a new rectangle path with four corner points (that don&#39;t have handles).</td></tr><tr><td>New Oval</td><td><img src="'+i+'" alt="Icon Tool - New Oval"></td><td>Draws a new oval path.</td></tr><tr><td>New Path</td><td><img src="'+D+'" alt="Icon Tool - New Path"></td><td>Draws a new path. Click once to add corner points. Click and drag to add a point with symmetric handles (this can be changed later). Once you&#39;re done creating a new path, you can select a different tool, or press the &quot;Done creating path&quot; button.</td></tr><tr><td>Add Path Point</td><td><img src="'+s+'" alt="Icon Tool - Add Path Point"></td><td>Adds a path point to a path that already exists.</td></tr><tr><td>Path edit</td><td><img src="'+B+'" alt="Icon Tool - Path edit"></td><td>This is the Pen tool, it allows you to select points, then move that point or move it&#39;s handles.</td></tr><tr><td>Resize</td><td><img src="'+n+'" alt="Icon Tool - Resize"></td><td>This is the Arrow tool, it allows you to select a whole path, then move it or resize it.</td></tr><tr><td>Kern</td><td><img src="'+M+'" alt="Icon Tool - Kern"></td><td>On the Kern page, this is the only tool, which adjusts the kern value.</td></tr></tbody></table><p>For the Path Edit and Resize tools, holding down <code>Ctrl</code> will allow you to multi-select either Paths or Path Points.</p><p>For the Add Path Point tool, holding down <code>Shift</code> will round the coordinate values of the new point to whole numbers.</p><h2 id="edit-canvas" tabindex="-1">Edit canvas <a class="header-anchor" href="#edit-canvas" aria-label="Permalink to &quot;Edit canvas&quot;">​</a></h2><p>The Edit Canvas is the visual representation of project data. Changes here will update the Panel area details as well.</p><p>Along the bottom there are canvas view controls, from left to right they are:</p><table tabindex="0"><thead><tr><th>View Tool</th><th>Icon</th><th>Description</th></tr></thead><tbody><tr><td>Pan</td><td><img src="'+r+'" alt="Icon Tool - Pan"></td><td>Move the view left / right / up / down. You can also toggle Pan by holding down <code>Space bar</code> or <code>Middle mouse wheel</code>.</td></tr><tr><td>Zoom</td><td><img src="'+d+'" alt="Icon Tool - Zoom Out"><img src="'+Y+'" alt="Icon Tool - Zoom In"></td><td>There are Zoom Out <code>-</code>, Zoom readout %, and Zoom In <code>+</code> controls grouped together. The <code>-</code> and <code>+</code> buttons adjust the zoom %.</td></tr><tr><td>Zoom 1:1</td><td><img src="'+P+'" alt="Icon Tool - Zoom 1:1"></td><td>The Zoom 1:1 button sets the zoom level such that 1 pixel on your screen is equal to 1 Em unit from your project.</td></tr><tr><td>Zoom to fit</td><td><img src="'+l+'" alt="Icon Tool - Zoom to fit"></td><td>This will auto-fit the current glyph to however big your window is currently.</td></tr><tr><td>Live Preview</td><td><img src="'+h+'" alt="Icon Tool - Live Preview"></td><td>Pop out a second screen for a live preview of your font.</td></tr></tbody></table>',17)]))}const v=e(c,[["render",C]]);export{z as __pageData,v as default};
